import * as React from 'react';
import dayjs, { Dayjs } from 'dayjs';
import { DemoContainer } from '@mui/x-date-pickers/internals/demo';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { DateField } from '@mui/x-date-pickers/DateField';
import { TextField, TextFieldProps } from '@mui/material';

type TVTextFieldProps = TextFieldProps & {
  name: string;
}

//export const VDateField: React.FC<TVTextFieldProps> = ({ name, ...rest }) => {
export const VDateField = () => {
  const [value, setValue] = React.useState<Dayjs | null>(dayjs('2020-10-01T03:00:00.000Z'));

  return (
    <LocalizationProvider dateAdapter={AdapterDayjs}>
      <DemoContainer components={['DateField', 'DateField']}>
        <DateField label="Uncontrolled field" defaultValue={dayjs('2020-10-01T03:00:00.000Z')} />
        <TextField
          type='date'
          defaultValue={dayjs('2020-10-01T03:00:00.000Z')}         
        />
        <DateField
          label="Controlled field"
          value={value}
          onChange={(newValue) => setValue(newValue)}
        />
      </DemoContainer>
    </LocalizationProvider>
  );
};
